export function ProductList(props) {
    return (
      <div className="col-md-6">
        <h1>Shop</h1>
        <div className="row">
          <div className="col-md-6">
            <h3>Products</h3>
            <div className="row">
              {props.date.map(elm => (
                <div className="col-md-4 my-4" key={elm.id}>
                  <p>{elm.title}</p>
                  <img src={elm.image} style={{ width: 200, height: 200 }} alt={elm.title} />
                  <p>{elm.description}</p>
                  <p><strong className="text-danger"> {elm.price} USD</strong></p>
                  <button onClick={() => props.onMove(elm)} className="btn btn-outline-dark">move</button>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    );
  }
